<script>
$( document ).ready(function() {

function playSound(){
  var pattern = [],
    tone;
  pattern.push(Math.floor(Math.random() * 988));
  tone = "#sound" + pattern[0];
  //$(tone).trigger('play');  //uncomment to play
  //$(tone).get(0).play();    //uncomment to play
  $(tone)[0].play();          //comment to turn off
}

function everyTime() {
    playSound();


}

};
